import ReactDOM from 'react-dom';
import axios from 'axios';

class UniversityList extends React.Component {


    constructor() {
        super();
        this.state = {
            'items': []
        }
    }
    componentDidMount() {
        this.UniversityData()
    }

    UniversityData() {
        axios.get('/api/university')
            .then(results => results.json())
            .then(results => this.setState({ 'items': results }))
    }
